import React, { Component } from "react";

class New extends Component {
  render() {
    return (
      <form id="new-post">
        <input type="file" name="" id="" />

        <input type="text" name="author" placeholder="Autor do post" />
        
        <input type="text"name='place'  placeholder='Local do post'/>
      </form>
    );
  }
}

export default New;
